INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "カリン", 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 0, 1, "", 60000, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 0, 2, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 3, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 1, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 0, 4, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 0, 5, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 0, 6, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 2, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 0, 7, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 0, 8, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 0, 9, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0, 10, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0, 11, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 3, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 0, 12, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 0, 13, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 0, 14, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 0, 15, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0, 16, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 4, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0, 17, "", 60000, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, 0, 18, "", 60000, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 190804, 0, 19, "", 60000, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ハツネ", 0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 101201, 0, 20, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ハツネ", 0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 1, 101201, 0, 21, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シオリ", 0, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 103801, 0, 22, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シオリ", 0, 1, "来年も、\n一緒にいられたら…\nうれしいな", 1, 103801, 0, 23, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キョウカ", 0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 2, 103601, 0, 24, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キョウカ", 0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 103601, 0, 25, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミミ", 0, 1, "おにいちゃんとあってから、\n1年たったよ～！", 2, 102001, 0, 26, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミミ", 0, 1, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 102001, 0, 27, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミソギ", 0, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 100401, 0, 28, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミソギ", 0, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 100401, 0, 29, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "マホ", 0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 3, 101001, 0, 30, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "マホ", 0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 3, 101001, 0, 31, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "イリヤ", 0, 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 3, 104401, 0, 32, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "イリヤ", 0, 1, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 3, 104401, 0, 33, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カオリ", 0, 2, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 3, 101701, 0, 34, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カオリ", 0, 2, "これからも、どうぞよろしく\nお願いするさ～！", 3, 101701, 0, 35, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "サレン", 0, 0, "あんたと出会ってからもうそんなに\nたつのね～", 4, 102801, 0, 36, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "サレン", 0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 4, 102801, 0, 37, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "スズメ", 0, 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 4, 102501, 0, 38, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "スズメ", 0, 1, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 4, 102501, 0, 39, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "タマキ", 0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 5, 104601, 0, 40, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "タマキ", 0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 5, 104601, 0, 41, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミフユ", 0, 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 5, 104801, 0, 42, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミフユ", 0, 1, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 5, 104801, 0, 43, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "アキノ", 0, 0, "あなたさまと出会ってもう1年…", 6, 103201, 0, 44, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "アキノ", 0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 6, 103201, 0, 45, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ユカリ", 0, 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 6, 103401, 0, 46, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ユカリ", 0, 1, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 6, 103401, 0, 47, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "クリスティーナ", 0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 7, 107101, 0, 48, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "クリスティーナ", 0, 0, "ともかくこれからも\n愉しませてくれよ☆", 7, 107101, 0, 49, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ジュン", 0, 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 7, 104701, 0, 50, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ジュン", 0, 1, "見えないから分からないって？\nそれもそうだな…", 7, 104701, 0, 51, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "トモ", 0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 8, 103701, 0, 52, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "トモ", 0, 0, "これからもよろしくね！", 8, 103701, 0, 53, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "マツリ", 0, 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 8, 100501, 0, 54, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "マツリ", 0, 1, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 8, 100501, 0, 55, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミヤコ", 0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 9, 100701, 0, 56, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミヤコ", 0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 9, 100701, 0, 57, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シノブ", 0, 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 9, 103101, 0, 58, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シノブ", 0, 1, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 9, 103101, 0, 59, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "アンナ", 0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 10, 100901, 0, 60, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "アンナ", 0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 10, 100901, 0, 61, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ナナカ", 0, 1, "君と出会ってもう1年だって！\n早いねー！", 10, 101301, 0, 62, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ナナカ", 0, 1, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 10, 101301, 0, 63, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミツキ", 0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 11, 105101, 0, 64, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ミツキ", 0, 0, "これからも、いろんなところを\n調べさせてね？", 11, 105101, 0, 65, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ルカ", 0, 1, "お前さんと出会ってもう1年か\n助太刀するつもりが", 11, 105601, 0, 66, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ルカ", 0, 1, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 11, 105601, 0, 67, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "エリコ", 0, 2, "早いものですわね、あなた様と\nお会いして、もう1年…", 11, 102701, 0, 68, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "エリコ", 0, 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 11, 102701, 0, 69, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "アヤネ", 0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 12, 102301, 0, 70, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "アヤネ", 0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 12, 102301, 0, 71, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "チカ", 0, 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12, 104201, 0, 72, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "チカ", 0, 1, "私のことを見守ってください\nできることなら、ずっと…", 12, 104201, 0, 73, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "クルミ", 0, 2, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12, 102101, 0, 74, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "クルミ", 0, 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 12, 102101, 0, 75, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シズル", 0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13, 104901, 0, 76, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シズル", 0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13, 104901, 0, 77, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "リノ", 0, 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13, 101101, 0, 78, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "リノ", 0, 1, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13, 101101, 0, 79, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ユイ", 0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14, 100201, 0, 80, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ユイ", 0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14, 100201, 0, 81, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ヒヨリ", 0, 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14, 100101, 0, 82, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ヒヨリ", 0, 1, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14, 100101, 0, 83, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "レイ", 0, 2, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14, 100301, 0, 84, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "レイ", 0, 2, "キミに背中を預けられる日が、\n早くきますように", 14, 100301, 0, 85, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15, 105801, 0, 86, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "これからもずっと、覚えていて\nくださいね！", 15, 105801, 0, 87, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15, 105901, 0, 88, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15, 105901, 0, 89, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15, 106001, 0, 90, "", 80001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15, 106001, 0, 91, "", 80001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "スズメ", 0, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 112101, 0, 92, "", 60001, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 0, 93, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 94, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 0, 95, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 0, 96, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 1, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 0, 97, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 0, 98, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 0, 99, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 0, 100, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 0, 101, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 2, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 0, 102, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 0, 103, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 0, 104, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0, 105, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0, 106, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0, 0, 107, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, 0, 108, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 3, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 0, 109, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 0, 110, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 0, 111, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 0, 112, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0, 113, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0, 114, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0, 0, 115, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 4, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0, 116, "", 60001, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "スズメ", 0, 3, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 112101, 0, 117, "", 60001, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "スズメ", 0, 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7, 112101, 0, 118, "", 60001, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 1, 105801, 0, 119, "", 80003, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 105901, 0, 120, "", 80003, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 105901, 0, 121, "", 80003, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "え？　ちょっと\nいきなりなにっ？", 1, 106001, 0, 122, "", 80003, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1, 106001, 0, 123, "", 80003, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1, 105801, 0, 124, "", 80003, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1, 105801, 0, 125, "", 80003, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 105901, 0, 126, "", 80003, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1, 106001, 0, 127, "", 80003, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 105901, 0, 128, "", 80003, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1, 105801, 0, 129, "", 80003, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1, 106001, 0, 130, "", 80003, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 105901, 0, 131, "", 80003, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2, 106001, 0, 132, "", 80003, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2, 190801, 0, 133, "", 80003, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "げっ…カリンじゃない\nなんでもないわよ！", 2, 106001, 0, 134, "", 80003, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 1, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 190801, 0, 135, "", 80003, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2, 106001, 0, 136, "", 80003, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 1, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2, 190801, 0, 137, "", 80003, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2, 106001, 0, 138, "", 80003, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2, 106001, 0, 139, "", 80003, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 1, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2, 190801, 0, 140, "", 80003, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2, 106001, 0, 141, "", 80003, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 1, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2, 190801, 0, 142, "", 80003, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2, 106001, 0, 143, "", 80003, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3, 105901, 0, 144, "", 80003, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 1, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3, 105801, 0, 145, "", 80003, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3, 105901, 0, 146, "", 80003, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3, 105901, 0, 147, "", 80003, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 1, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3, 105801, 0, 148, "", 80003, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 1, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3, 105801, 0, 149, "", 80003, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 3, 105901, 0, 150, "", 80003, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 1, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3, 105801, 0, 151, "", 80003, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3, 105901, 0, 152, "", 80003, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 1, "えへへ、ありがとうございます\nコッコロちゃん！", 3, 105801, 0, 153, "", 80003, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3, 105901, 0, 154, "", 80003, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 1, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3, 105801, 0, 155, "", 80003, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4, 105801, 0, 156, "", 80003, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4, 106001, 0, 157, "", 80003, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4, 105801, 0, 158, "", 80003, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4, 106001, 0, 159, "", 80003, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4, 105801, 0, 160, "", 80003, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "…積極的？\nなんの話よ？", 4, 106001, 0, 161, "", 80003, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4, 105801, 0, 162, "", 80003, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 4, 105801, 0, 163, "", 80003, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4, 106001, 0, 164, "", 80003, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4, 105801, 0, 165, "", 80003, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4, 106001, 0, 166, "", 80003, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4, 106001, 0, 167, "", 80003, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5, 106001, 0, 168, "", 80003, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5, 105901, 0, 169, "", 80003, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5, 106001, 0, 170, "", 80003, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5, 105901, 0, 171, "", 80003, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5, 106001, 0, 172, "", 80003, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5, 105901, 0, 173, "", 80003, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5, 106001, 0, 174, "", 80003, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5, 105901, 0, 175, "", 80003, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "かくし芸？", 5, 106001, 0, 176, "", 80003, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5, 105901, 0, 177, "", 80003, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5, 106001, 0, 178, "", 80003, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6, 105801, 0, 179, "", 80003, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6, 106001, 0, 180, "", 80003, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6, 105901, 0, 181, "", 80003, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6, 105801, 0, 182, "", 80003, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6, 106001, 0, 183, "", 80003, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6, 105901, 0, 184, "", 80003, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6, 106001, 0, 185, "", 80003, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6, 106001, 0, 186, "", 80003, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6, 106001, 0, 187, "", 80003, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6, 105801, 0, 188, "", 80003, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6, 105901, 0, 189, "", 80003, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6, 106001, 0, 190, "", 80003, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7, 106001, 0, 191, "", 80003, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7, 106001, 0, 192, "", 80003, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7, 106001, 0, 193, "", 80003, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "あー\nあー\n…声、これで大丈夫かしら？", 7, 106001, 0, 194, "", 80003, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7, 106001, 0, 195, "", 80003, 34);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "オイッスー☆", 7, 106001, 0, 196, "", 80003, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 7, 106001, 0, 197, "", 80003, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7, 106001, 0, 198, "", 80003, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7, 106001, 0, 199, "", 80003, 38);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8, 105901, 0, 200, "", 80003, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8, 105901, 0, 201, "", 80003, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8, 105901, 0, 202, "", 80003, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8, 105901, 0, 203, "", 80003, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8, 105901, 0, 204, "", 80003, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "オイッスー☆", 8, 105901, 0, 205, "", 80003, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8, 105901, 0, 206, "", 80003, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8, 105901, 0, 207, "", 80003, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8, 105901, 0, 208, "", 80003, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "オイッスー☆", 9, 105801, 0, 209, "", 80003, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9, 105801, 0, 210, "", 80003, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あと６日で2.5周年ですか…", 9, 105801, 0, 211, "", 80003, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9, 105801, 0, 212, "", 80003, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9, 105801, 0, 213, "", 80003, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "オイッスー☆", 9, 105801, 0, 214, "", 80003, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9, 105801, 0, 215, "", 80003, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9, 105801, 0, 216, "", 80003, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9, 105801, 0, 217, "", 80003, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9, 105801, 0, 218, "", 80003, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9, 105801, 0, 219, "", 80003, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10, 105801, 0, 220, "", 80003, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10, 105901, 0, 221, "", 80003, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10, 105801, 0, 222, "", 80003, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "…………", 10, 106001, 0, 223, "", 80003, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10, 105901, 0, 224, "", 80003, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10, 106001, 0, 225, "", 80003, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10, 105801, 0, 226, "", 80003, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10, 106001, 0, 227, "", 80003, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10, 105801, 0, 228, "", 80003, 34);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10, 105801, 0, 229, "", 80003, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10, 106001, 0, 230, "", 80003, 42);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10, 105901, 0, 231, "", 80003, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10, 106001, 0, 232, "", 80003, 43);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10, 105801, 0, 233, "", 80003, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11, 190801, 0, 234, "", 80003, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11, 190801, 0, 235, "", 80003, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11, 190801, 0, 236, "", 80003, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11, 190801, 0, 237, "", 80003, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11, 190801, 0, 238, "", 80003, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 11, 190801, 0, 239, "", 80003, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11, 190801, 0, 240, "", 80003, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11, 190801, 0, 241, "", 80003, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "あれ？\nもしかして緊張で気を失って…？", 11, 190801, 0, 242, "", 80003, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11, 190801, 0, 243, "", 80003, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11, 190801, 0, 244, "", 80003, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "それでは\nまた明日お会いしましょう♪", 11, 190801, 0, 245, "", 80003, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12, 106001, 0, 246, "", 80003, 44);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 2, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12, 105801, 0, 247, "", 80003, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12, 105901, 0, 248, "", 80003, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12, 106001, 0, 249, "", 80003, 45);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 2, "ひどいですよぉキャルちゃ～ん！", 12, 105801, 0, 250, "", 80003, 38);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12, 105901, 0, 251, "", 80003, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 2, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12, 105801, 0, 252, "", 80003, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12, 106001, 0, 253, "", 80003, 46);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12, 105901, 0, 254, "", 80003, 34);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 2, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12, 105801, 0, 255, "", 80003, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13, 105801, 0, 256, "", 80003, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13, 106001, 0, 257, "", 80003, 47);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "忘れてきちゃいました☆", 13, 105801, 0, 258, "", 80003, 42);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13, 106001, 0, 259, "", 80003, 48);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13, 105901, 0, 260, "", 80003, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13, 106001, 0, 261, "", 80003, 49);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13, 105801, 0, 262, "", 80003, 43);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13, 106001, 0, 263, "", 80003, 50);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13, 105901, 0, 264, "", 80003, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13, 106001, 0, 265, "", 80003, 51);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13, 105901, 0, 266, "", 80003, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13, 106001, 0, 267, "", 80003, 52);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13, 105801, 0, 268, "", 80003, 44);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13, 105901, 0, 269, "", 80003, 38);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13, 105801, 0, 270, "", 80003, 45);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13, 106001, 0, 271, "", 80003, 53);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13, 105801, 0, 272, "", 80003, 46);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "こんにちは\n【ギルド管理協会】のカリンです", 14, 190801, 0, 273, "", 80003, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "昨日の生放送は\nいかがだったでしょうか？", 14, 190801, 0, 274, "", 80003, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14, 190801, 0, 275, "", 80003, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14, 190801, 0, 276, "", 80003, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14, 190801, 0, 277, "", 80003, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14, 190801, 0, 278, "", 80003, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14, 190801, 0, 279, "", 80003, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14, 190801, 0, 280, "", 80003, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14, 190801, 0, 281, "", 80003, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14, 190801, 0, 282, "", 80003, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "準備はいいですかっ？\n…いっきますよー！", 15, 105801, 0, 283, "", 80003, 47);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "祝！", 15, 106001, 0, 284, "", 80003, 54);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "2.5周年！", 15, 105901, 0, 285, "", 80003, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "おめでとうございま～す☆", 15, 105801, 0, 286, "", 80003, 48);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15, 106001, 0, 287, "", 80003, 55);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15, 105901, 0, 288, "", 80003, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15, 105801, 0, 289, "", 80003, 49);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15, 106001, 0, 290, "", 80003, 56);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15, 105901, 0, 291, "", 80003, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15, 106001, 0, 292, "", 80003, 57);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15, 105801, 0, 293, "", 80003, 50);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15, 106001, 0, 294, "", 80003, 58);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "記念日だから\n平気平気♪\nやばいですね☆", 15, 105801, 0, 295, "", 80003, 51);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "意味分かんないわよ！", 15, 106001, 0, 296, "", 80003, 59);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15, 105901, 0, 297, "", 80003, 42);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15, 105901, 0, 298, "", 80003, 43);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15, 105801, 0, 299, "", 80003, 52);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 2, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15, 106001, 0, 300, "", 80003, 60);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15, 105901, 0, 301, "", 80003, 44);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15, 105801, 0, 302, "", 80003, 53);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ・コッコロ・キャル", 0, 0, "2.5周年\nありがとうございます！", 15, 105801, 1, 303, "105901,45,106001,61", 80003, 54);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "カリン", 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 0, 304, "", 60002, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 0, 305, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 306, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 0, 307, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 0, 308, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 1, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 0, 309, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 0, 310, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 0, 311, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 0, 312, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 0, 313, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 2, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 0, 314, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 0, 315, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 0, 316, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0, 317, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 0, 318, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0, 0, 319, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0, 320, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 3, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0, 0, 321, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 0, 322, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 0, 323, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 0, 324, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0, 325, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0, 326, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 0, 327, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 4, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0, 328, "", 60002, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804, 0, 329, "", 60002, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 190804, 0, 330, "", 60002, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "ささ、シェフィさまはこちらへ…", 1, 105901, 0, 331, "", 80005, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "コッコロさん、どこへ行くの…？\n…え？", 1, 106401, 0, 332, "", 80005, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 105801, 0, 333, "", 80005, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1, 105901, 0, 334, "", 80005, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "ええと…\n二人とも何をしているの？", 1, 106401, 0, 335, "", 80005, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 106001, 0, 336, "", 80005, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "あの日…？", 1, 106401, 0, 337, "", 80005, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1, 105801, 0, 338, "", 80005, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 1, 105801, 0, 339, "", 80005, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "やばいですね☆", 1, 190801, 0, 340, "", 80005, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "って、なにしれっと\n参加してんのよカリン！", 1, 106001, 0, 341, "", 80005, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1, 190801, 0, 342, "", 80005, 2);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1, 190801, 0, 343, "", 80005, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1, 105801, 0, 344, "", 80005, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 1, 106401, 0, 345, "", 80005, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2, 105801, 0, 346, "", 80005, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2, 105901, 0, 347, "", 80005, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2, 105901, 0, 348, "", 80005, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2, 105801, 0, 349, "", 80005, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "さすがでございます\nペコリーヌさま", 2, 105901, 0, 350, "", 80005, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2, 106001, 0, 351, "", 80005, 3);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 106401, 0, 352, "", 80005, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2, 105801, 0, 353, "", 80005, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "さ、次はキャルさまの\n番でございますよ", 2, 105901, 0, 354, "", 80005, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2, 106001, 0, 355, "", 80005, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 106401, 0, 356, "", 80005, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2, 106001, 0, 357, "", 80005, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 2, 106001, 0, 358, "", 80005, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2, 105901, 0, 359, "", 80005, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2, 106001, 0, 360, "", 80005, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3, 105901, 0, 361, "", 80005, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 105801, 0, 362, "", 80005, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3, 105901, 0, 363, "", 80005, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "聖学祭…って、なにかしら？", 3, 106401, 0, 364, "", 80005, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3, 105901, 0, 365, "", 80005, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3, 106001, 0, 366, "", 80005, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3, 106001, 0, 367, "", 80005, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 105801, 0, 368, "", 80005, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "いや、そのまんますぎでしょ…", 3, 106001, 0, 369, "", 80005, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3, 106401, 0, 370, "", 80005, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 105801, 0, 371, "", 80005, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "えっ？　ええ…\nぎゅーっ…？", 3, 106401, 0, 372, "", 80005, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4, 106001, 0, 373, "", 80005, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4, 106401, 0, 374, "", 80005, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4, 106001, 0, 375, "", 80005, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4, 105901, 0, 376, "", 80005, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4, 106001, 0, 377, "", 80005, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4, 105801, 0, 378, "", 80005, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4, 106001, 0, 379, "", 80005, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4, 106001, 0, 380, "", 80005, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4, 106401, 0, 381, "", 80005, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4, 105801, 0, 382, "", 80005, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4, 105901, 0, 383, "", 80005, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4, 106001, 0, 384, "", 80005, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4, 106401, 0, 385, "", 80005, 12);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5, 105801, 0, 386, "", 80005, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5, 105801, 0, 387, "", 80005, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5, 105801, 0, 388, "", 80005, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5, 106001, 0, 389, "", 80005, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5, 106001, 0, 390, "", 80005, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5, 106401, 0, 391, "", 80005, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5, 105901, 0, 392, "", 80005, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5, 105801, 0, 393, "", 80005, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5, 106001, 0, 394, "", 80005, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5, 105801, 0, 395, "", 80005, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5, 105801, 0, 396, "", 80005, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5, 105801, 0, 397, "", 80005, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6, 190801, 0, 398, "", 80005, 4);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6, 190801, 0, 399, "", 80005, 5);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "…えっ！？", 6, 106001, 0, 400, "", 80005, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6, 105801, 0, 401, "", 80005, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6, 106401, 0, 402, "", 80005, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6, 105901, 0, 403, "", 80005, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6, 106401, 0, 404, "", 80005, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6, 106001, 0, 405, "", 80005, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6, 105801, 0, 406, "", 80005, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "ぶっ殺すぞ！？", 6, 106001, 0, 407, "", 80005, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 190801, 0, 408, "", 80005, 6);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7, 105901, 0, 409, "", 80005, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7, 106001, 0, 410, "", 80005, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7, 106401, 0, 411, "", 80005, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7, 105801, 0, 412, "", 80005, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7, 106001, 0, 413, "", 80005, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7, 106401, 0, 414, "", 80005, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7, 105901, 0, 415, "", 80005, 16);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7, 106401, 0, 416, "", 80005, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "もちろんでございます\n仲良くお勉強いたしましょう", 7, 105901, 0, 417, "", 80005, 17);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "しれっと教育ママが\n生まれてる…？", 7, 106001, 0, 418, "", 80005, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7, 105801, 0, 419, "", 80005, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "え～～～～！？", 7, 106001, 0, 420, "", 80005, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8, 106001, 0, 421, "", 80005, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8, 106401, 0, 422, "", 80005, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8, 105901, 0, 423, "", 80005, 18);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8, 105801, 0, 424, "", 80005, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8, 106401, 0, 425, "", 80005, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8, 106001, 0, 426, "", 80005, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8, 105901, 0, 427, "", 80005, 19);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8, 106401, 0, 428, "", 80005, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8, 106001, 0, 429, "", 80005, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8, 106001, 0, 430, "", 80005, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8, 105801, 0, 431, "", 80005, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8, 106001, 0, 432, "", 80005, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9, 106401, 0, 433, "", 80005, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 9, 106401, 0, 434, "", 80005, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9, 106401, 0, 435, "", 80005, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9, 106401, 0, 436, "", 80005, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9, 106401, 0, 437, "", 80005, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "それから、それから…！\nぅ、ぅぅっ…！", 9, 106401, 0, 438, "", 80005, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "―びえぇぇ～んっ！！！", 9, 106401, 0, 439, "", 80005, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "どうされましたか、シェフィさま", 9, 105901, 0, 440, "", 80005, 20);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "ううっ…ひっく…\nママッ…！", 9, 106401, 0, 441, "", 80005, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9, 105901, 0, 442, "", 80005, 21);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9, 105901, 0, 443, "", 80005, 22);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9, 106401, 0, 444, "", 80005, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "主さま\n3.5周年まであと５日\nでございます", 10, 105901, 0, 445, "", 80005, 23);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "ですがその前に\n生放送がありますね", 10, 105901, 0, 446, "", 80005, 24);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "…生放送に向けた\n意気込みでございますか？", 10, 105901, 0, 447, "", 80005, 25);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10, 105901, 0, 448, "", 80005, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10, 105901, 0, 449, "", 80005, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10, 105901, 0, 450, "", 80005, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10, 105901, 0, 451, "", 80005, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10, 105901, 0, 452, "", 80005, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10, 105901, 0, 453, "", 80005, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "3.5周年まであと４日！\nやばいですね☆", 11, 105801, 0, 454, "", 80005, 26);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11, 106001, 0, 455, "", 80005, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11, 105801, 0, 456, "", 80005, 27);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11, 105801, 0, 457, "", 80005, 28);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11, 105801, 0, 458, "", 80005, 29);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11, 106001, 0, 459, "", 80005, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11, 105801, 0, 460, "", 80005, 30);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11, 105801, 0, 461, "", 80005, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11, 105801, 0, 462, "", 80005, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "だからあたしはやるなんて一言も…", 11, 106001, 0, 463, "", 80005, 34);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 0, "オイッスー☆", 11, 105801, 0, 464, "", 80005, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "聞きなさいっての！！", 11, 106001, 0, 465, "", 80005, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "3.5周年まであと３日…\nそして生放送は、明日…", 12, 106401, 0, 466, "", 80005, 31);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12, 106401, 0, 467, "", 80005, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "おいっす！\n…こうじゃなかったわね\nええと確か…", 12, 106401, 0, 468, "", 80005, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12, 106401, 0, 469, "", 80005, 34);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12, 106401, 0, 470, "", 80005, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "やってますねシェフィちゃん！", 12, 105801, 0, 471, "", 80005, 34);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "なによ、考えることは\nみんな同じってこと？", 12, 106001, 0, 472, "", 80005, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12, 105901, 0, 473, "", 80005, 32);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "みんな…もちろんよ！", 12, 106401, 0, 474, "", 80005, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12, 105801, 0, 475, "", 80005, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13, 190801, 0, 476, "", 80005, 7);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13, 190801, 0, 477, "", 80005, 8);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13, 105801, 0, 478, "", 80005, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13, 190801, 0, 479, "", 80005, 9);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13, 105901, 0, 480, "", 80005, 33);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 13, 190801, 0, 481, "", 80005, 10);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "大丈夫…大丈夫…\nあたしは大丈夫…", 13, 106001, 0, 482, "", 80005, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13, 190801, 0, 483, "", 80005, 11);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "あうー？", 13, 106401, 0, 484, "", 80005, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "みんな", 0, 4, "あ…", 13, 105801, 1, 485, "105901,34,106001,38,190801,12", 80005, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13, 106001, 0, 486, "", 80005, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13, 105901, 0, 487, "", 80005, 35);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13, 105801, 0, 488, "", 80005, 38);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 190801, 0, 489, "", 80005, 13);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14, 106401, 0, 490, "", 80005, 38);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14, 105801, 0, 491, "", 80005, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14, 106001, 0, 492, "", 80005, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14, 105901, 0, 493, "", 80005, 36);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14, 106401, 0, 494, "", 80005, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14, 105801, 0, 495, "", 80005, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 1, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14, 105901, 0, 496, "", 80005, 37);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14, 106001, 0, 497, "", 80005, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "へ、へぇ…", 14, 106401, 0, 498, "", 80005, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14, 105801, 0, 499, "", 80005, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14, 106401, 0, 500, "", 80005, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 2, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14, 106401, 0, 501, "", 80005, 42);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15, 105801, 0, 502, "", 80005, 42);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "祝！", 15, 106001, 0, 503, "", 80005, 42);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "3.5周年！", 15, 105901, 0, 504, "", 80005, 38);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "おめでとうございます！", 15, 106401, 0, 505, "", 80005, 43);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15, 190801, 0, 506, "", 80005, 14);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "カリン", 0, 2, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 190801, 0, 507, "", 80005, 15);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15, 105801, 0, 508, "", 80005, 43);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15, 105801, 0, 509, "", 80005, 44);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15, 106001, 0, 510, "", 80005, 43);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "キャル", 0, 1, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15, 106001, 0, 511, "", 80005, 44);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15, 106401, 0, 512, "", 80005, 44);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "シェフィ", 0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15, 106401, 0, 513, "", 80005, 45);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15, 105901, 0, 514, "", 80005, 39);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15, 105901, 0, 515, "", 80005, 40);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "コッコロ", 0, 4, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15, 105901, 0, 516, "", 80005, 41);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "ペコリーヌ", 0, 3, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15, 105801, 0, 517, "", 80005, 45);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (0, "みんな", 0, 4, "これからも\nよろしくおねがいします！", 15, 105801, 1, 518, "105901,42,106001,45,106401,46,190801,16", 80005, 46);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "カリン", 0, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804, 0, 519, "", 60003, 1);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 0, 520, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0, 521, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, 0, 522, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 1, 2, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0, 0, 523, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 1, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 0, 524, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 0, 525, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 0, 526, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0, 0, 527, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 2, 2, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, 0, 528, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 2, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 0, 529, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 0, 530, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 0, 531, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0, 532, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 0, 533, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0, 0, 534, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 3, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0, 535, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (2, "", 3, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0, 0, 536, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 0, 537, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 0, 538, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 0, 539, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 0, 0, 540, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0, 541, "", 60003, 0);
INSERT INTO `v1_b2df4b898e2fd50beb5df7a37579a56a654ac5842d0d274ec5e2be10a8b21b6e` VALUES (1, "", 4, 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 0, 542, "", 60003, 0);
